    constructor(props){
        super(props)
        this.fileInputRef = React.createRef();
    }
    render() {
        return (
            <div className="Dropzone">
                <input 
                ref={this.fileInputRef}
                className={"FileInput"}
                type={"file"}
                multiple onChange={this.onFilesAdded}
                />

                <h1>image upload</h1>
                    <div className={"Card"} >
                        {/* <span> */}
                            < DisplayColors />
                            < DisplayColors />
                            < DisplayColors />
                        {/* </span> */}
                        <span>
                            < DisplayFeatureImage />
                        </span>
                    </div>
                    < MatchedImages />
            </div>
        );
    }
}

export default ImageUpload;
